    e.preventDefault();
    // Handle quiz submission
  };

  return (
    <form onSubmit={handleSubmit}>
      <div>
        <label for="quiz-title">Quiz Title</label>
        <input
          type="text"
          id="quiz-title"
          value={title}
          onChange={(e) => setTitle(e.target.value)}
          placeholder="Enter the quiz title"
          aria-required="true"
